CREATE TABLE bike_prices (
    bike_price_id INTEGER PRIMARY KEY AUTOINCREMENT,
    bike_id INTEGER NOT NULL,
    price REAL NOT NULL,
    datetime TEXT NOT NULL,
    FOREIGN KEY (bike_id) REFERENCES bikes (bike_id) ON DELETE CASCADE
);

